
<script>
  function logToServer(message)
    {
      var xhr = new XMLHttpRequest();
      xhr.onreadystatechange = function(e) {
        if (xhr.readyState == 4 && xhr.status == 200) {
          var responseText = xhr.responseText;

          console.log("Response from server: " + responseText);
        }
      };
      //post request
      xhr.open("POST", "https://dev.previewlabs.com/ABM/log.php" + "?message=" + message, true);
      xhr.send();
    }

window.onerror = function (message, source, lineno, colno, error) {
  // Construct an object with error information
  var errorData = {
    message: message,
    source: source,
    lineno: lineno,
    colno: colno,
    error: error
  };

  // Send the error data to your server using an XMLHttpRequest or other method
  logToServer("ERROR:" + JSON.stringify(errorData));

  // Prevent the default browser error handling
  return true;
};

// Override the onunhandledrejection event to capture unhandled promise rejections
window.onunhandledrejection = function (event) {
  // Extract information from the event object
  var errorData = {
    message: event.reason.message,
    source: 'unhandledrejection',
    // Add other relevant properties from event.reason as needed
  };

  // Send the error data to your server using an XMLHttpRequest or other method
  logToServer("REJECTION: " + errorData);
};

// Override the console.warn method to capture warning messages
var originalConsoleWarn = console.warn;
console.warn = function () {
  // Convert the arguments (which are the warning messages) to an array
  var warningMessages = Array.prototype.slice.call(arguments);

  // Log or send the warning messages to the server
  logToServer("WARNING: " + warningMessages);

  // Call the original console.warn method
  return originalConsoleWarn.apply(console, arguments);
};


// Override the console.log method to capture log messages
var originalConsoleLog = console.log;
console.log = function () {
  // Convert the arguments (which are the log messages) to an array
  var logMessages = Array.prototype.slice.call(arguments);

  // Log or send the log messages to the server
  logToServer(JSON.stringify({ messages: logMessages }));

  // Call the original console.log method
  return originalConsoleLog.apply(console, arguments);
};

console.log("test log");

window.navigator.gamepadInputEmulation = "keyboard";
</script>
